// Dashboard.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LeetCodeProfile = ({ username }) => {
  const [solvedCount, setSolvedCount] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const url = `http://localhost:3001/scrapeLeetCode/${username}`;
        const response = await axios.get(url);
        console.log(response.data);
        setSolvedCount(response.data.solvedCount);
      } catch (error) {
        console.error('Error:', error.message);
      }
    };

    fetchData();
  }, [username]);

  return (
    <div>
      <h2>LeetCode Profile for {username}</h2>
      {solvedCount !== null ? (
        <p>Solved Problems: {solvedCount}</p>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

const Dashboard = () => {
  const leetCodeUsername = 'HARI_PRASAD_2003';

  return (
    <div>
      <h1>Dashboard</h1>
      <LeetCodeProfile username={leetCodeUsername} />
    </div>
  );
};

export default Dashboard;
